# @version 0.2.11
#留言定位

struct Publisher:
    weight: int128
    published: bool
    delegate: address
    publish: int128

struct Proposal:
    name: bytes32
    publishCount: int128

publishers: public(HashMap[address, Publisher])
proposals: public(HashMap[int128, Proposal])
publisherCount: public(int128)
chairperson: public(address)
int128Proposals: public(int128)


@view
@internal
def _delegated(addr: address) -> bool:
    return self.publishers[addr].delegate != ZERO_ADDRESS


@view
@external
def delegated(addr: address) -> bool:
    return self._delegated(addr)


@view
@internal
def _directlyVoted(addr: address) -> bool:
    return self.publishers[addr].published and (self.publishers[addr].delegate == ZERO_ADDRESS)


@view
@external
def directlyVoted(addr: address) -> bool:
    return self._directlyVoted(addr)

@external
def __init__(_proposalNames: bytes32[2]):
    self.chairperson = msg.sender
    self.publisherCount = 0
    for i in range(2):
        self.proposals[i] = Proposal({
            name: _proposalNames[i],
            publishCount: 0
        })
        self.int128Proposals += 1

@external
def giveRightToVote(publisher: address):
    assert msg.sender == self.chairperson
    assert not self.publishers[publisher].published
    assert self.publishers[publisher].weight == 0
    self.publishers[publisher].weight = 1
    self.publisherCount += 1

@internal
def _forwardWeight(delegate_with_weight_to_forward: address):
    assert self._delegated(delegate_with_weight_to_forward)
    assert self.publishers[delegate_with_weight_to_forward].weight > 0

    target: address = self.publishers[delegate_with_weight_to_forward].delegate
    for i in range(4):
        if self._delegated(target):
            target = self.publishers[target].delegate
            assert target != delegate_with_weight_to_forward
        else:
            break

    weight_to_forward: int128 = self.publishers[delegate_with_weight_to_forward].weight
    self.publishers[delegate_with_weight_to_forward].weight = 0
    self.publishers[target].weight += weight_to_forward

    if self._directlyVoted(target):
        self.proposals[self.publishers[target].publish].publishCount += weight_to_forward
        self.publishers[target].weight = 0

@external
def forwardWeight(delegate_with_weight_to_forward: address):
    self._forwardWeight(delegate_with_weight_to_forward)

@external
def delegate(to: address):
    assert not self.publishers[msg.sender].published
    assert to != msg.sender
    assert to != ZERO_ADDRESS
    self.publishers[msg.sender].published = True
    self.publishers[msg.sender].delegate = to
    self._forwardWeight(msg.sender)

@external
def publish(proposal: int128):
    assert not self.publishers[msg.sender].published
    assert proposal < self.int128Proposals
    self.publishers[msg.sender].publish = proposal
    self.publishers[msg.sender].published = True
    self.proposals[proposal].publishCount += self.publishers[msg.sender].weight
    self.publishers[msg.sender].weight = 0

@view
@internal
def _successProposal() -> int128:
    success_publish_count: int128 = 0
    success_proposal: int128 = 0
    for i in range(2):
        if self.proposals[i].publishCount > success_publish_count:
            success_publish_count = self.proposals[i].publishCount
            success_proposal = i
    return success_proposal

@view
@external
def successProposal() -> int128:
    return self._successProposal()

@view
@external
def successName() -> bytes32:
    return self.proposals[self._successProposal()].name
